import React from 'react';
import { PayPalScriptProvider } from "@paypal/react-paypal-js";
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import './Css/App.css'
import PageComponent from './PageComponent.js'
import MenuBar from './MenuBar.js';
import ContactNavBar from './Contact.js';
import 'bootstrap/dist/css/bootstrap.min.css';
function App() {
  const initialoptions = {
    "client-id": "YOUR-CLIENT-ID-HERE", // Replace with your actual client ID from PayPal
    currency: "USD", // Set your preferred currency
    intent: "capture", // The intent of the payment (e.g., capture, authorize)
  }
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<MenuBar/>} />
        <Route path="/PageComponent" element={<PageComponent/>} /> 
        <Route path="/Contact" element={<ContactNavBar/>} /> 
        <PayPalScriptProvider options={initialoptions}> 

        </PayPalScriptProvider>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
